  <!--JAVASCRIPT-->
  <script>
    // Mouse wheel scroll horizontal
    const wrapper = document.querySelector('.scroll-wrapper');
    wrapper.addEventListener('wheel', function (e) {
      e.preventDefault();
      wrapper.scrollLeft += e.deltaY;
    }, { passive: false });

    // Scale using transform
    function scaleContent() {
      const baseWidth = 1920;
      const baseHeight = 1080;
      const scaleW = window.innerWidth / baseWidth;
      const scaleH = window.innerHeight / baseHeight;
      const scale = Math.min(scaleW, scaleH);

      const scaler = document.querySelector('.scaler');
      scaler.style.transform = `scale(${scale})`;
      scaler.style.transformOrigin = 'top left';

      // Set exact size so the wrapper knows how much to scroll
      scaler.style.width = `${baseWidth}px`;
      scaler.style.height = `${baseHeight}px`;
    }

    scaleContent();
    window.addEventListener('resize', scaleContent);
  </script>
